import React from "react";
import { useNavigate } from "react-router-dom";
import Base from "../components/Base";
const Success = () => {
  
  const navigate = useNavigate();
const navigateTo=(event)=>{ navigate("/successful")}

  return (
    <Base>
    <br/><br/><br/><br/><br/><br/>
      <h1>Post Deleted Succesfully</h1>
      <button onClick={navigateTo} className="">CLick here to go back</button>
    </Base>
  );
};

export default Success;
